import { BrowserRouter } from 'react-router-dom';
import './App.css';
import { Nav } from './components/nav';
import { Routing } from './components/routing';

function App() {
  return (
    <BrowserRouter>
      <Nav ></Nav>
      <div className='container' style={{backgroundColor: '#e2f3f3',height: '70vh', overflowY: 'auto'}}>
           <Routing></Routing>
      </div>
    </BrowserRouter>
  );
}

export default App;
